import React from "react";
import ReactDOM from "react-dom";

const flname = "ambarish bhagawati";

ReactDOM.render(
  <>
    <h1>My name is {flname}</h1>
    <p>addition {56+4546} </p>
    <p>Random number {Math.random()} </p>
  </>,
  document.getElementById("root")
);
